INSERT INTO `productos` VALUES (1,'../img/biciFijaPanther4.jpg',26999,6,'Bici fija Panther Pro',1,'#Maq',5,'Tipo de bicicleta fija: Spinning','Tipo de resistencia: Mecánico','Peso máximo soportado: 100 kg','Con computadora: Sí',20,'Es momento de empezar con el cambio y tener un estilo de vida más activa y saludable. Con este producto Panther Pro BF102 entrenar es un desafío y superarse la meta.  Entrenamiento y salud Con esta bicicleta practicá spinning, una de las actividades más completas para realizar en casa o en el gimnasio. La inercia del volante es resistente y permite mayores posibilidades de ejercicio. Divertite al simular el pedaleo rápido, fuertes subidas de montaña y ejercitate al ritmo de la música. '),(2,'../img/eliptico2.jpg',51424,6,'Caminadora Eliptico Magnetico profesional',1,'#Maq',8,'Tipo de ejercicios: Elíptico','Peso máximo de usuario: 160 kg','Tipo de resistencia: Magnética','Monitor: Sí',20,'Estructura Reforzado de caños cilíndricos trifilados con tejido interno para soportar mayores pesos y exigencias en el uso. Peso máximo: 160 kilos.Resistencia magnética en 8 posiciones. Disco de inercia: 7 kilos !!                 Excelente biomecánica sin impacto. Silencioso.   Posee ruedas para un fácil movimiento y traslado. Regatones con regulación de nivelación y fijación al tipo de piso. '),(3,'../img/caminadora.jpg',72990,3,'Cinta de correr eléctrica Enerfit',0,'#Maq',3,'Tipo de cinta para correr: Eléctrica','Peso máximo soportado: 130 kg','Velocidad máxima: 16 km/h','Es plegable: Sí',10,'Potenciá el entrenamiento Con su motor eléctrico, tu Enerfit 720 Plus ofrece equilibrio y constancia en el ritmo. Calentar, caminar y correr a la velocidad que te propongas es posible. ¡No dejes de alcanzar tus objetivos!Entrenamientos de gran exigencia Su potencia y su velocidad te permitirán llevar tu entrenamiento a otro nivel y superar nuevas marcas. Es ideal para las exigencias de un profesional del deporte.Práctica y cómoda Gracias a su diseño plegable podrás trasladarla y guardarla en cualquier rincón sin ninguna dificultad. ¡Entrená cuándo y dónde quieras!Ideal para tus carrerasCuanto más potente es el motor, más tiempo durará tu cinta de correr. A mayor potencia, mayor velocidad y mayor intensidad del entrenamiento. Con una potencia de 2.5 hp esta cinta se recomienda para la carrera o si tu IMC es superior a 30.  '),(4,'../img/miniEscalador.jpg',9999,3,'Mini stepper Jdm Sport Con Bandas Es-018',1,'#Maq',3,'Con manubrio: No','Tecnología: Hidráulica','Peso máximo soportado: 100 kg','Ancho x Profundidad x Altura: 35 cm x 47 cm x 23 cm',20,'Mini stepper Jdm Sport Con Bandas Es-018\",\n        \"prodDescripcion\": \" Uso residencial.   Peso maximo soportado: 100Kg. Compacto. Monitor Electrónico: Si. Funciones del monitor: tiempo, escaneo, conteo de pasos, conteo total y las calorías. El monitor utiliza una pila AAA, la duracion de la pila es de 1 año aprox bajo uso normal. Las pilas no esta incluidas. Peso del producto: 7 Kg. Peso de la caja: 8 Kg. Medidas maxima del producto: 42,5 alto X 29,5 ancho X 20,5cm largo. Medidas de la caja: 48 X 36 X 23cm'),(5,'../img/remo.jpg',59990,6,'Maquina Simulador De Remo Magnetico Plegable',1,'#Maq',3,'Peso máximo soportado: 110 kg','Es plegable: Sí','Largo x Ancho: 185 m x 55 cm','Cantidad de niveles de intensidad: 10',20,'Apto para uso residencial. Soporta usuarios de hasta 110 kilogramos.Plegable, para su fácil guardado.Guía de movimiento metálica de primerísima calidad y terminación.  Asiento grande y cómodo.   10 niveles de resistencia.   Distancia de separación máxima entre asiento y posapies de 100 centímetros Computadora con funciones de SCAN, tiempo, contador de pasos, distancia y calorías consumidas. Funciona con dos baterías AAA. Con soporte para smartphone o tablet.  Se vende en caja. Muy fácil armado. Instructivo con imágenes y en castellano. Medidas del remo armado 185 x 55 x 45 centímetros de largo, ancho y alto Medidas del remo plegado de 130 centímetros de alto Medidas del embalaje 107 x 28 x 46 centímetros Peso 25 kilogramos '),(6,'../img/airBike.jpg',149999,6,'Bicicleta Fija de aire Air Bike',1,'#Maq',3,'Tipo de bicicleta fija: Airbike','Peso máximo soportado: 130 kg','Tipo de resistencia: De aire','Con computadora: Sí',20,'La Airbike es una bicicleta de aire única, construida con un marco fabricado en acero de alta resistencia completa sellado con una capa de pintura de recubrimiento en polvo industrial. Cuenta con una pantalla LCD nítida con la que vas a poder seguir todo tu entrenamiento. Elegí entre intervalos de alta intensidad o establecé una distancia objetivo o metas. La Airbike cumple con el desafío de aumentar gradualmente la resistencia de forma automática a medida que el atleta empuja, tirar y pedalea con mayor velocidad y fuerza. De hecho puede proporcionar un entrenamiento prácticamente ilimitado.'),(7,'../img/barraOlimpica.jpg',14990,12,'Barra Olimpica 1,83 Mts. 15 Kg. Rulemanes',0,'#PesDisBar',6,'Largo: 1.83 m','Material: Cromada','Diámetro: 50 mm','Incluye topes para barra: Sí',20,'Barra Olimpica 1,83 Mts  CON RULEMANES Y EXTREMOS GIRATORIOS. INCLUYE TOPES.  COLORES DISPONIBLES: CROMADA     MATERIAL: META  MEDIDAS LARGO: 1.83 mts LARGO INTERNO AGARRE: 1.24 mts LARGO SUPERFICIE DE CARGA: 26cm Diametro carga discos: 50mm  Diametro empuñadura:28mm   PESO MÁXIMO DE CARGA: 150kg   PRECIO POR UNIDAD . NO INCLUYE DISCOS '),(8,'../img/colchonetaYoga.jpg',1384,12,'Colchoneta Mat Yoga Pilates Enrollable Premium ',1,'#funcPilYog',10,'Largo x Ancho: 173 cm x 61 cm','antideslizante','Espesor: 6 mm','Material: PVC',20,'Mr Gym Fitness ….Primeros en Calidad! COLCHONETA MAt PREMIUM 6 MM Fitness – Yoga – Meditación    Descripción v Enrollable v Transportable v Super liviana '),(9,'../img/calzasHombres.jpg',7250,6,'Calza Corta Running Hombre Osx Chicago',1,'#Ind',15,'Género: Hombre','Tipo de calza: Deportiva','Tipo de largo: Corto','Tiro de la calza: Medio',20,'Calza Corta Alta Compresion Bolsillos laterales .    Bolsillo trasero '),(10,'../img/prodFotos-1632252255821-232977799calzalargaHombre.jpg',2199,12,'Calza Larga Spandex Termica Compresion Running Rugby',1,'#Ind',20,'Género: Hombre','Tipo de calza: LARGA','Composición: Poliester y Spandex',NULL,10,'Material principal: Poliéster'),(11,'../img/prodFotos-1632253440044-839930585calzasMujer.jpg',6280,6,'Calza Corta Running Trail Mujer Osx',0,'#Ind',30,'Género: Mujer','Tipo de largo: Corto','Composición: Poliéster / elastano','Tiro de la calza: Medio',10,'Calza Corta\\r\\nBolsillo trasero con CierreBolsillo lateral con CierreTextil ultra DryRespirable');
